import React from 'react'
import { Outlet, Link } from "react-router-dom";

function Survey() {
  return (
    <>
      <nav>
        <ul>
          <li>
            <Link to="/Home">Click here to start the survey</Link>
          </li>
        </ul>
      </nav>

      <Outlet />
    </>
  )
}

export default Survey;
